CKEDITOR.plugins.setLang("a11yhelp","sl",{title:"Navodila za dostopnost",contents:"Vsebina pomo\u010di. \u010ce \u017eelite zapreti pogovorno okno, pritisnite ESC.",legend:[{name:"Splo\u0161no",items:[{name:"Orodna vrstica urejevalnika",legend:"Pritisnite ${toolbarFocus} za pomik v orodno vrstico. Z TAB in SHIFT+TAB se pomikate na naslednjo in prej\u0161njo skupino orodne vrstice. Z DESNO PU\u0160\u010cICO ali LEVO PU\u0160\u010cICO se pomikate na naslednji in prej\u0161nji gumb orodne vrstice. Pritisnite SPACE ali ENTER, da aktivirate gumb orodne vrstice."},{name:"Urejevalno Pogovorno Okno",legend:"Inside a dialog, press TAB to navigate to the next dialog element, press SHIFT+TAB to move to the previous dialog element, press ENTER to submit the dialog, press ESC to cancel the dialog. When a dialog has multiple tabs, the tab list can be reached either with ALT+F10 or with TAB as part of the dialog tabbing order. With tab list focused, move to the next and previous tab with RIGHT and LEFT ARROW, respectively."},{name:"Kontekstni meni urejevalnika",legend:"Pritisnite ${contextMenu} ali APPLICATION KEY, da odprete kontekstni meni. Nato se premaknite na naslednjo mo\u017enost menija s tipko TAB ali PU\u0160\u010cICA DOL. Premakniti se na prej\u0161njo mo\u017enost z SHIFT + TAB ali PU\u0160\u010cICA GOR. Pritisnite SPACE ali ENTER za izbiro mo\u017enosti menija. Odprite podmeni trenutne mo\u017enosti menija s tipko SPACE ali ENTER ali DESNA PU\u0160\u010cICA. Vrnite se na mati\u010dni element menija s tipko ESC ali LEVA PU\u0160\u010cICA. Zaprite kontekstni meni z ESC."},{name:"Urejevalno Seznamsko Polje",legend:"Znotraj seznama, se premaknete na naslednji element seznama s tipko TAB ali PU\u0160\u010cICO DOL. Z SHIFT+TAB ali PU\u0160\u010cICO GOR se premaknete na prej\u0161nji element seznama. Pritisnite tipko SPACE ali ENTER za izbiro elementa. Pritisnite tipko ESC, da zaprete seznam."},{name:"Urejevalna vrstica poti elementa",legend:"Pritisnite ${elementsPathFocus} za pomikanje po vrstici elementnih poti. S TAB ali DESNA PU\u0160\u010cICA se premaknete na naslednji gumb elementa. Z SHIFT+TAB ali LEVO PU\u0160\u010cICO se premaknete na prej\u0161nji gumb elementa. Pritisnite SPACE ali ENTER za izbiro elementa v urejevalniku."}]},{name:"Ukazi",items:[{name:"Razveljavi ukaz",legend:"Pritisnite ${undo}"},{name:"Ponovi ukaz",legend:"Pritisnite ${redo}"},{name:"Krepki ukaz",legend:"Pritisnite ${bold}"},{name:"Le\u017ee\u010di ukaz",legend:"Pritisnite ${italic}"},{name:"Poudarni ukaz",legend:"Pritisnite ${underline}"},{name:"Ukaz povezave",legend:"Pritisnite ${link}"},{name:"Skr\u010di Orodno Vrstico Ukaz",legend:"Pritisnite ${toolbarCollapse}"},{name:"Dostop do prej\u0161njega ukaza ostrenja",legend:"Pritisnite ${accessPreviousSpace} za dostop do najbli\u017ejega nedosegljivega osredoto\u010denega prostora pred stre\u0161ico, npr.: dva sosednja HR elementa. Ponovite kombinacijo tipk, da dose\u017eete oddaljene osredoto\u010dene prostore."},{name:"Dostop do naslednjega ukaza ostrenja",legend:"Pritisnite ${accessNextSpace} za dostop do najbli\u017ejega nedosegljivega osredoto\u010denega prostora po stre\u0161ici, npr.: dva sosednja HR elementa. Ponovite kombinacijo tipk, da dose\u017eete oddaljene osredoto\u010dene prostore."},{name:"Pomo\u010d dostopnosti",legend:"Pritisnite ${a11yHelp}"},{name:" Paste as plain text",legend:"Press ${pastetext}",legendEdge:"Press ${pastetext}, followed by ${paste}"}]}],tab:"Tab",pause:"Pause",capslock:"Caps Lock",escape:"Escape",pageUp:"Page Up",pageDown:"Page Down",leftArrow:"Pu\u0161\u010dica levo",upArrow:"Pu\u0161\u010dica gor",rightArrow:"Pu\u0161\u010dica desno",downArrow:"Pu\u0161\u010dica dol",insert:"Insert",leftWindowKey:"Leva tipka Windows",rightWindowKey:"Desna tipka Windows",selectKey:"Select tipka",numpad0:"Numpad 0",numpad1:"Numpad 1",numpad2:"Numpad 2",numpad3:"Numpad 3",numpad4:"Numpad 4",numpad5:"Numpad 5",numpad6:"Numpad 6",numpad7:"Numpad 7",numpad8:"Numpad 8",numpad9:"Numpad 9",multiply:"Zmno\u017ei",add:"Dodaj",subtract:"Od\u0161tej",decimalPoint:"Decimalna vejica",divide:"Deli",f1:"F1",f2:"F2",f3:"F3",f4:"F4",f5:"F5",f6:"F6",f7:"F7",f8:"F8",f9:"F9",f10:"F10",f11:"F11",f12:"F12",numLock:"Num Lock",scrollLock:"Scroll Lock",semiColon:"Podpi\u010dje",equalSign:"Ena\u010daj",comma:"Vejica",dash:"Vezaj",period:"Pika",forwardSlash:"Desna po\u0161evnica",graveAccent:"Krativec",openBracket:"Oklepaj",backSlash:"Leva po\u0161evnica",closeBracket:"Zaklepaj",singleQuote:"Opu\u0161\u010daj"});